// 苹果框 - 最小堆

type pair struct {
	llt, applesNum int
}

type applesStore []pair

func (a applesStore) Len() int {
	return len(a)
}
func (a applesStore) Swap(i, j int) {
	a[i], a[j] = a[j], a[i]
}
func (a applesStore) Less(i, j int) bool {
	return a[i].llt < a[j].llt
}

func (a *applesStore) Push(u any) {
	(*a) = append((*a), u.(pair))
}

func (a *applesStore) Pop() any {
	// u := (*a)[0]
	// (*a) = (*a)[1:]
	u := (*a)[a.Len()-1]
	(*a) = (*a)[:a.Len()-1]
	return u
}

func eatenApples(apples []int, days []int) int {
	n := len(apples)
	ans, day := 0, 0

	h := applesStore{}
	heap.Init(&h)

	for ; day < n; day++ {

		for len(h) > 0 && (h[0].llt <= day || h[0].applesNum == 0) {
			heap.Pop(&h)
			continue
		}
		if apples[day] != 0 {
			heap.Push(&h, pair{days[day] + day, apples[day]})
		}

		if len(h) > 0 && h[0].applesNum > 0 {
			ans++
			h[0].applesNum--
		}
	}
	if n < 100 {
		log.Printf("  len(h)  %d  \n", len(h))
		log.Printf(" h %+v day %d ans %d \n", h, day, ans)
	}
	for len(h) > 0 {
		if h[0].llt <= day || h[0].applesNum == 0 {
			heap.Pop(&h)
			continue
		}
		u := heap.Pop(&h).(pair)
		if n < 100 {
			log.Printf("in after u %+v \n", u)
		}

		m := min(u.llt-day, u.applesNum)

		if n < 100 {
			log.Printf("in after m %d \n", m)
		}
		ans += m
		day += m
	}

	return ans
}
